  \"In situ, navigational, physical and profile data collected by Seoul National University
  at OceanSITES site EC1 from 2011-03-12 to 2012-06-12 (NCEI Accession 0130539)\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 2,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-02-26T22:17:11.589397\",\n\t\"name\": \"in-situ-navigational-physical-and-profile-data-collected-by-seoul-national-university-at-o\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In situ, navigational, physical and profile
  oceanographic data were collected, including CURRENT SPEED - EAST/WEST COMPONENT
  (U), CURRENT SPEED - NORTH/SOUTH COMPONENT (V), HYDROSTATIC PRESSURE, LATITUDE,
  LONGITUDE and SALINITY from Moored Buoy at the Seoul National University (SNU) long-term
  current moorings (EC1) using ADCP and current meter from 2011-03-12 to 2012-06-12.
  These data were provided to one of the OceanSITES Data Assembly Centers (DAC). The
  DAC formatted this information into the OceanSITES file format and passed it on
  to the Global Data Assembly Centers (GDAC).OceanSITES is a worldwide system of long-term,
  open-ocean reference stations measuring dozens of variables and monitoring the full
  depth of the ocean from air-sea interactions down to the seafloor. It is a network
  of stations or observatories measuring many aspects of the ocean's surface and water
  column using, where possible, automated systems with advanced sensors and telecommunications
  systems, yielding high time resolution, often in real-time, while building a long
  record.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
